B.Fg=new A.b4(8,{"Prior breast cancer":"The advanced breast cancer risk calculator is not applicable for individuals with any previous diagnosis of breast cancer, LCIS (lobular carcinoma in situ), DCIS (ductal carcinoma in situ), or prior mastectomy. ",Age:"The risk of developing breast cancer increases with age. The great majority of breast cancer cases occur in individuals older than age 60. Most cancers develop slowly over time. For this reason, breast cancer is more common among older individuals. \n\nThe BCSC cumulative 6-year Advanced Breast Cancer Risk Calculator is NOT applicable to individuals younger than 40 or older than age 74.","Race and ethnicity":"The advanced breast cancer risk calculator is calibrated for non-Hispanic White, non-Hispanic Black, Asian, Other/multiple, and Hispanic individuals. If the woman's race/ethnicity is unknown, the tool will use data for non-Hispanic White individuals to estimate the risk.","Family history of breast cancer":"Having one or more first-degree relatives (mother, sisters, daughters) or second-degree relatives (aunts, grandmothers) who have had breast cancer increases an individual's chances of developing breast cancer.","Breast biopsy":"Individuals who have had breast biopsies have an increased risk of breast cancer, especially if their biopsy specimens showed atypical ductal hyperplasia or lobular carcinoma in situ. Individuals who have a history of breast biopsies are at increased risk because of breast changes that can be observed on mammograms and prompt the biopsies. Breast biopsies themselves do not cause cancer.","BI-RADS\xae breast density":"Individuals who have high breast density have an increased risk of breast cancer. Breast density is determined by the relative amounts of fat, epithelial, and connective tissues that appear differently on a mammogram due to differences in X-ray attenuation. Fat appears radiolucent or dark, while epithelial and connective tissues are radiographically dense and appear light or white. A dense breast has less fat than glandular and connective tissue and has more breast cells. Mammograms of breasts with high density are harder to read and interpret than those of less dense breasts and individuals with dense breasts are more likely to develop breast cancer.","Menopausal status":"Menopause is defined as the permanent cessation of ovulation, marked by the end of menstruation for a year. \n\nBased on prior BCSC research, individuals under the age of 40 are assumed to be Premenopausal and individuals aged 60 or older are assumed to be Postmenopausal in the BCSC risk calculators regardless of the menopausal status selected by the user.","Body Mass Index (BMI)":u.I},B.aJV,t.li)
